import './menudisplay.css';

const MenuDisplay = ({info}) =>{
	console.log(info)

	return (
		<>	
				{info.map(item =>(
				 <div className="Menu-list">
					 <div className="Menu-list-item">{item.item}</div> ... 
					 <div className="Menu-list-price">{item.price}</div>
				 </div>

				))}


		</>
	)

}




export default MenuDisplay;
